import Calculater from "./components/Counter";
import { Provider } from "react-redux";
import { store } from "./store";
import Header from "./components/Header";
import { Auth } from "./components/Auth";
function AppContent() {
  return (
    <>
      <Header />
      {/* <Calculater /> */}
      <Auth />
    </>
  );
}

export const App = () => {
  <Provider store={store}>
    <AppContent />
  </Provider>;
};
